import React from 'react'
import {Box, ChakraProvider, Divider, Text} from '@chakra-ui/react'

const Footer = () => {
    return (
        <ChakraProvider>
            <Box w="1364px">
            <Divider />
            </Box>
            <Text>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Eius voluptatum, quod eligendi hic similique quos, voluptas delectus autem architecto explicabo fuga, tempora nesciunt perferendis! Architecto asperiores eos nisi vero excepturi!</Text>
        </ChakraProvider>
    )
}

export default Footer
